import 'dart:convert';

class PropertyDocument {
	int? id;
	String? name;
	String? path;
	int? propertyForSaleId;
	DateTime? createdAt;
	DateTime? updatedAt;

	PropertyDocument({
		this.id, 
		this.name, 
		this.path, 
		this.propertyForSaleId, 
		this.createdAt, 
		this.updatedAt, 
	});

	factory PropertyDocument.(Map<String, dynamic> data) {
		return PropertyDocument(
			id: data['id'] as int?,
			name: data['name'] as String?,
			path: data['path'] as String?,
			propertyForSaleId: data['property_for_sale_id'] as int?,
			createdAt: data['created_at'] == null
						? null
						: DateTime.parse(data['created_at'] as String),
			updatedAt: data['updated_at'] == null
						? null
						: DateTime.parse(data['updated_at'] as String),
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'name': name,
			'path': path,
			'property_for_sale_id': propertyForSaleId,
			'created_at': createdAt?.toIso8601String(),
			'updated_at': updatedAt?.toIso8601String(),		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [PropertyDocument].
	factory PropertyDocument.fromJson(String data) {
		return PropertyDocument.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [PropertyDocument] to a JSON string.
	String toJson() => json.encode(());
}
